import React from "react";
import { getMatches, getFullName } from "../../../axios/axios";
import styles from './MatchPage.module.css'


class MatchDetailPage extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            matchPage: {}
        }
    }

    getFullNameCallback = (data) => {
        console.log(data)
    }

    getMatchesCallback = (data) => {
        console.log(data)

        getFullName(this.getFullNameCallback, data[0].p1Email)
        getFullName(this.getFullNameCallback, data[0].p2Email)
    }
    componentDidMount() {
        getMatches(this.getMatchesCallback, "?id=" + this.props.match.params.id)
    }

    render() {
        return (
            <div className={styles.match}>
                {console.log(this.props.match.params.id)}
            </div>
        )
    }

}

export default MatchDetailPage;
